#!/usr/bin/env node
/**
 * sample_nlogn.js
 * O(n log n) example (sort).
 * Usage: node sample_nlogn.js <N>
 */
const n = parseInt(process.argv[2] || "5000", 10);

function nlogn(n) {
  const arr = Array.from({ length: n }, () => Math.random());
  arr.sort();
  return [arr[0], arr[arr.length - 1]];
}

const start = Date.now();
const [min, max] = nlogn(n);
const elapsed = (Date.now() - start) / 1000;
console.log(`n=${n}, min=${min.toFixed(6)}, max=${max.toFixed(6)}, time_s=${elapsed.toFixed(6)}`);

